import { Paper, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

export const Destinations = () => {
  return (
    <Box sx={{
        display: "flex",
        justifyContent: "center",
        height: "100vh"
    }}>
         <Box sx={{
            display: 'flex',
            marginTop: "4.5rem",
            flexWrap: 'wrap',
            '& > :not(style)': {
                width: 975,
                height: 600,
            },
        }}>
            <Paper elevation={6}>
                <Box>
                    <img src='../img/Imagen1.jpg' alt=''/>
                </Box>
            </Paper>
        </Box>
    </Box>
  )
}
